function Datacard(ID, DATA, AVAIL, SPEC, YEAR, COST, CARDS, PROTO, NATION, NAME) {
  //set on construct
    this.iUnitID = ID;
    this.sNameU = NAME;
    this.sNation = NATION;
    this.sUnitData = DATA;
    this.iaAvailability = AVAIL; //[5]
    this.sSpecDeck = SPEC;
    this.iYear = YEAR;
    this.iCost = COST;
    this.iCards = CARDS;
    this.iIsProto = PROTO;
    //set on traits
    this.iHP = "";
    this.iSize = ""; // also ECM, as :1-2-3-4-5 vsmall, small, med, big, vbig. 0,10+ is ECM
    this.iOptics = ""; // also ECM, as :1-2-3-4-5 vsmall, small, med, big, vbig, 0,10+ is ECM
    this.iSpeed = "";
    this.iRSpeed = "";
    this.iASpeed = "";
    this.iTraining = ""; // 1-2-3-4, militia, line, shock, elite,
    this.iStealth = ""; //1-2-3-4-5, poor-med-good-vgood-exc,
    this.iAutonomy = 0;
    this.iaArmor = [0, 0, 0, 0];
    //set on Weaponize
    this.W1 = [0, 0];
    this.W2 = [0, 0];
    this.W3 = [0, 0];
}

function VehicleCard(VET, UNIT, TRANSPORT, CRAFT) {
    this.sVeterancy = VET; // expected binary
    this.iVet = parseInt(VET, 2);
    this.iVet0 = this.iVet; //normalized
    this.sNation = UNIT.sNation; //trusting the database here
    this.UnitTypeData = UNIT.sUnitData.slice(17); //fucking javascript and fucking passbyreff and fuck landing craft it's all their fault
    if (TRANSPORT == 0){ //unit
      this.iYear = UNIT.iYear;
      this.sSpec = UNIT.sSpecDeck;
      this.iIsProto = UNIT.iIsProto;
      this.iaAvailability = UNIT.iaAvailability;
      this.iCost = UNIT.iCost;
      this.Unit = UNIT;
      this.Transport = 0;
      this.Craft = 0;
    }
    else if (TRANSPORT == 1 || TRANSPORT == CardsDB[573][0] || TRANSPORT == CardsDB[458][1]){//naval unit
      if (Deck.iSide == 0){ //oddly enough, you never [[make]] a unit card without setting the side first.
        this.Transport = CardsDB[573][0];
      } else{
        this.Transport = CardsDB[458][1];
      }
      this.iYear = UNIT.iYear;
      this.sSpec = "1111111"; //naval is unlimited
      this.iIsProto = UNIT.iIsProto;
      this.iaAvailability = UNIT.iaAvailability;
      this.iCost = UNIT.iCost + this.Transport.iCost;
      this.Unit = UNIT;
      this.UnitTypeData = "000000001"
      this.Craft = 0;
    }
    else if (CRAFT == 0){ // inf
      this.iYear = UNIT.iYear < TRANSPORT.iYear ? UNIT.iYear : TRANSPORT.iYear;
      this.sSpec = "";
      for (var i = 0; i < 7; i++){
          if (UNIT.sSpecDeck.charAt(i) == '0' || TRANSPORT.sSpecDeck.charAt(i) == '0') { this.sSpec += '0'; } else {this.sSpec += '1'; } //"JS strings are immutable" WTF?!?
      }
      if (UNIT.iIsProto === 1 || TRANSPORT.iIsProto === 1) { this.iIsProto = 1; } else { this.iIsProto = 0}
      this.iaAvailability = [];
      for (var i = 0; i < 5; i++){
        this.iaAvailability[i] = UNIT.iaAvailability[i] < TRANSPORT.iaAvailability[i] ? UNIT.iaAvailability[i] : TRANSPORT.iaAvailability[i];
      }
      this.iCost = UNIT.iCost + TRANSPORT.iCost;
      this.Unit = UNIT;
      this.Transport = TRANSPORT;
      this.Craft = 0;
    }
    else if (CRAFT == 1 || CRAFT == CardsDB[573][0] || CRAFT == CardsDB[458][1]){ //naval inf
      if (Deck.iSide == 0){
        this.Craft = CardsDB[573][0];
      } else{
        this.Craft = CardsDB[458][1];
      }
      this.iYear = UNIT.iYear < TRANSPORT.iYear ? UNIT.iYear : TRANSPORT.iYear;
      this.sSpec = "1111111";
      if (UNIT.iIsProto === 1 || TRANSPORT.iIsProto === 1) { this.iIsProto = 1; } else { this.iIsProto = 0}
      this.iaAvailability = [];
      for (var i = 0; i < 5; i++){
        this.iaAvailability[i] = UNIT.iaAvailability[i] < TRANSPORT.iaAvailability[i] ? UNIT.iaAvailability[i] : TRANSPORT.iaAvailability[i];
      }
      this.iCost = UNIT.iCost + TRANSPORT.iCost + this.Craft.iCost;
      this.Unit = UNIT;
      this.UnitTypeData = "000000001";
      this.Transport = TRANSPORT;
    }
}


function Traits(Card, HP, SIZE, OPTICS, SPEED, RSPEED, ASPEED, TRAINING, STEALTH, AUTON, AV) {
  Card.iHP = HP;
  Card.iSize = SIZE;
  Card.iOptics = OPTICS;
  Card.iSpeed = SPEED;
  Card.iRSpeed = RSPEED;
  Card.iASpeed = ASPEED;
  Card.iTraining = TRAINING;
  Card.iStealth = STEALTH;
  Card.iAutonomy = AUTON;
  Card.iaArmor = AV;
}

